// CreatedAtLTE applies the LTE predicate on the "created_at" field.
func CreatedAtLTE(v time.Time) predicate.ERPAttachment {
	return predicate.ERPAttachment(sql.FieldLTE(FieldCreatedAt, v))
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.ERPAttachment) predicate.ERPAttachment {
	return predicate.ERPAttachment(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.ERPAttachment) predicate.ERPAttachment {
	return predicate.ERPAttachment(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.ERPAttachment) predicate.ERPAttachment {
	return predicate.ERPAttachment(sql.NotPredicates(p))
}
